[{"operationName":"singleFetchMicroDPCardQuery","variables":{"courseId":"n2zunIlgEeWSMw6QLoDNsQ","skipCourseQuery":false,"s12nId":"PLACEHOLDER","skipS12nQuery":true},"query":"query singleFetchMicroDPCardQuery($courseId: String!, $skipCourseQuery: Boolean!, $s12nId: String!, $skipS12nQuery: Boolean!) {
  CoursesV1Resource @skip(if: $skipCourseQuery) {
    get(id: $courseId) {
      ...FullCourseFragment
      __typename
    }
    __typename
  }
  OnDemandSpecializationsV1Resource @skip(if: $skipS12nQuery) {
    get(id: $s12nId) {
      ...FullS12nFragment
      __typename
    }
    __typename
  }
}

fragment FullCourseFragment on CoursesV1 {
  ...LightweightCourseFragment
  courseDerivativesV2 {
    skillTags {
      skillName
      relevanceScore
      __typename
    }
    avgLearningHoursAdjusted
    commentCount
    averageFiveStarRating
    ratingCount
    __typename
  }
  __typename
}

fragment LightweightCourseFragment on CoursesV1 {
  id
  slug
  name
  photoUrl
  s12nIds
  level
  workload
  primaryLanguages
  partners {
    elements {
      id
      name
      squareLogo
      classLogo
      logo
      __typename
    }
    __typename
  }
  courseTypeMetadata {
    courseTypeMetadata {
      ...RhymeProjectFragment
      __typename
    }
    __typename
  }
  __typename
}

fragment RhymeProjectFragment on CourseTypeMetadataV1_rhymeProjectMember {
  ... on CourseTypeMetadataV1_rhymeProjectMember {
    rhymeProject {
      typeNameIndex
      __typename
    }
    __typename
  }
  __typename
}

fragment FullS12nFragment on OnDemandSpecializationsV1 {
  ...LightweightS12nFragment
  derivativeV2 {
    averageFiveStarRating
    avgLearningHoursAdjusted
    __typename
  }
  courses {
    elements {
      courseDerivativesV2 {
        skillTags {
          skillName
          relevanceScore
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
  __typename
}

fragment LightweightS12nFragment on OnDemandSpecializationsV1 {
  name
  id
  slug
  logo
  courseIds
  partners {
    elements {
      id
      name
      squareLogo
      classLogo
      logo
      __typename
    }
    __typename
  }
  metadata {
    headerImage
    level
    __typename
  }
  productVariant
  __typename
}
"}]
